import classes from './Cart.module.css';
import { useSelector } from 'react-redux';

const Cart = () => {
  const store = useSelector(state => state);
  console.log(store.cart);

  return (
    <div className={classes.Box}>
      {store.cart.map(el => (
        <div  className={classes.Container}>{el.name}</div>
      ))}
    </div>
  );
};

export default Cart;
